export default function NavbarDropdown(toggle) {
  co;

  return (
    <>
      <nav className="navbar navbar-expand-lg bg-body-tertiary bg-secondary">
        <div className="container-fluid">
          <NavBarMenu title="admin" items={menuItems} />
          <div>
            <div className="dropdown text-end">
              <a
                onClick={toggleDropdown}
                href="#"
                className="d-block link-dark text-decoration-none dropdown-toggle"
                aria-expanded="false"
              >
                <img
                  src={img}
                  alt="mdo"
                  width="32"
                  height="32"
                  className="rounded-circle"
                />
              </a>
              <ul
                className={`dropdown-menu text-small end-0  ${
                  showDropdown && "show"
                }`}
              >
                {items.map((item) => {
                  if (item.label === "---") {
                    return (
                      <li>
                        <hr className="dropdown-divider" />
                      </li>
                    );
                  }
                  return (
                    <li>
                      <a>{}</a>
                    </li>
                  );
                })}
              </ul>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
}
